                                    </li>
                                    <li>
                                        <div class="form-input-text">
                                            <input name="txtShareholdingDate" type="text" value="2019/01/25" id="txtShareholdingDate" class="input-searchDate active" />
							            </div>
                                    </li>
                                </ul>
                            </div>                          
							<div class="filter__buttonGroup">
                                <input type="submit" name="btnSearch" value="搜尋" onclick="return preprocessMutualMarketMainForm($(&#39;#txtShareholdingDate&#39;).val());" id="btnSearch" title="搜尋" class="btn-blue" />
					        </div>
                        
                            <div class="filter__note">
                                <p>
                                    <span style="font-weight: bold; text-decoration: underline;">附註:</span>
                                    <table class="note-table">
<tr>
<td style="width:20px;">1.</td>
<td>
佔深交所上市及交易的Ａ股總數的百分比是按深交所相關上市公司的上市及交易的Ａ股總數而計算，有機會沒有包括公司行動的相關變化，因此可能不是最新的。該數值只作為參考之用，使用該百分比時敬請注意。
</td>
<tr>
<td>2.</td>
<td>
用以計算持股百分比的"深交所上市及交易的A股總數"有機會不等於相應深交所上市公司的已發行股份總數。
</br></br>
如閣下需要參考深交所上市公司的"已發行股份總數"以作中國監控境外投資者之持股比例限制，就深交所上市公司，請參閱載於深交所網頁（<a target="_blank" href="http://www.szse.cn/main/marketdata/jypz/colist/">http://www.szse.cn/main/marketdata/jypz/colist/</a>）之已發行股份總數（包括任何Ａ股、Ｂ股、Ｈ股及其他非流通股份）。
</td></tr>
<tr>
<td>3.</td>
<td>
下列股份名單並不代表深股通的合資格股份名單，如欲查詢合資格股份名單的相關資料，請參閱相關港交所網站（<a target="_blank" href="http://www.hkex.com.hk/chi/csm/securities_eligible_stocks.htm">http://www.hkex.com.hk/chi/csm/securities_eligible_stocks.htm</a>）。
</td>
</tr>
</table>
